import { useState } from 'react';
import './index.scss';

function App() {

  const [count, setCount] = useState(0);

  onclickPlus = () => {
    setCount + 1
  }
  return (
    <div className="App">
      <div>
        <h2>Счетчик:</h2>
        <h1>0</h1>
        <button className="minus">- Минус</button>
        <button className="plus" onClick={onclickPlus}>Плюс +</button>
      </div>
    </div>
  );
}

export default App;
